import { Grid, TextField } from '@material-ui/core';

const SignUp = () => {
	return (
		<Grid container style={{ backgroundColor : 'red' }}>
			<Grid item sm={4}>
				<TextField 
					id="outlined-basic" 
					label="first name" 
					variant="outlined" 
				/>
			</Grid>
			<Grid>
				<TextField 
					id="outlined-basic" 
					label="last name" 
					variant="outlined" 
				/>
			</Grid>		
		</Grid>
	);
};

export default SignUp;
